import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import Card from 'react-bootstrap/Card';
import badge from './images/badge.png';
import {
    Container,
    Row,
    Col
} from 'react-bootstrap';
import uw from './images/W.png';
import sched from './images/sched.png';
import roster from './images/uwroster.png';

function Rewards() {
    return(
        <div className='App-header'>
            <div style={{ marginTop: '5rem', justifyContent: 'right'}}>
                <img width='120' src={badge} style={{marginBottom: '0.5rem'}} /> 
            </div>
            <div style={{ display: 'flex'}}>
                <Card style={{ width: '30rem', height: '18rem', background: '#4B2E83' }}>
                </Card>
                <Card style={{ width: '30rem', height: '18rem', background: '#4B2E83' }}>
                </Card>
            </div>
            <div style={{ display: 'flex', marginTop: '3rem'}}>
                <Card style={{ width: '30rem', height: '18rem', background: '#4B2E83' }}>
                </Card>
                <Card style={{ width: '30rem', height: '18rem', background: '#4B2E83' }}>
                </Card>
            </div>
        </div>
    );
}

export default Rewards;
